import { useEffect, useState } from "react";
import WeaponsList from '../assets/weapons.json';

export default function Weapons() {
    
    return(
      <>
        {WeaponsList.map((weapon) => (
          <div key={weapon.id}>
            {weapon.name}
          </div>
        ))}
      </>
    );
}
